%[text] ## Import Data
thisFilePath = matlab.desktop.editor.getActiveFilename;
[thisFolder, ~, ~] = fileparts(thisFilePath);

rootFolder = fileparts(thisFolder);

powerDataPath = fullfile(rootFolder, 'data', 'ErcotPowerDemand.csv');
windDataPath = fullfile(rootFolder, 'data', 'RoscoeTimeWindPower.csv');


windOpts = detectImportOptions(windDataPath);
powerOpts = detectImportOptions(powerDataPath);
windData = readtable(windDataPath, windOpts) %[output:5d0661bb]
powerData = readtable(powerDataPath, powerOpts) %[output:27157dd0]

windTimestamp                       = windData.TIMESTAMP;
hoursFromZero                       = windData.HOURS_FROM_ZERO;
interval                            = windData.INTERVAL;
windSpeed                           = windData.WIND_SPEED;
windSpeedAtHeight                   = windData.WIND_SPEED_AT_HEIGHT;
windSpeedRounded                    = windData.WIND_SPEED_ROUNDED;  
powerProduced_kW                    = windData.POWER_OUTPUT_kW;
energyGeneratedInterval_kWh         = windData.ENERGY_GENERATED_INTERVAL_kWh;
energyGeneratedTotal_kWh            = windData.TOTAL_ENERGY_kWh;
        
        
powerTimestamp                      = powerData.TIMESTAMP;
powerConsumed_mW                    = powerData.SCENT;
powerConsumedUnreduced_kW           = powerConsumed_mW * 1000; % convert from MW to kW and then reduce load by a factor of 1000 to make numbers more digestible 
powerConsumed_kW                    = powerConsumed_mW * 1000/1000;
energyConsumedIntervalUnreduced_kWh = powerConsumed_kW * 1     %[output:14d4fd2b]
energyConsumedTotalUnreduced_kWh    = powerData.SCENT_TOTAL_ENERGY_kWh;
energyConsumedInterval_kWh          = powerConsumed_kW * 1/1000     %[output:9336a060]
energyConsumedTotal_kWh             = powerData.SCENT_TOTAL_ENERGY_kWh/1000;




windDates  = datetime(windTimestamp, 'InputFormat', 'yyyy-MM-dd'' ''HH:mm:ss');
powerDates = datetime(powerTimestamp, 'InputFormat', 'yyyy-MM-dd'' ''HH:mm:ss');
%%
%[text] ## Wind Speed Graph
figure; %[output:855e487d]
hold on %[output:855e487d]
plot(windDates, windSpeedAtHeight) %[output:855e487d]
xlabel("date") %[output:855e487d]
ylabel("wind speed (m/s)") %[output:855e487d]
title("Speed at time"); %[output:855e487d]
hold off %[output:855e487d]
%%
%[text] ## Wind Power Graph
figure; %[output:185a78d5]
hold on %[output:185a78d5]
plot(windDates, powerProduced_kW) %[output:185a78d5]
xlabel("date") %[output:185a78d5]
ylabel("power produced (kW)") %[output:185a78d5]
title("Instantaneous Power Produced"); %[output:185a78d5]
hold off %[output:185a78d5]
%%
%[text] ## Wind Total Energy Graph
figure; %[output:6d6bdc6f]
hold on %[output:6d6bdc6f]
plot(windDates, energyGeneratedTotal_kWh) %[output:6d6bdc6f]
xlabel("date") %[output:6d6bdc6f]
ylabel("total energy produced (kWh)") %[output:6d6bdc6f]
title("Total Energy Generated During 2025"); %[output:6d6bdc6f]
hold off %[output:6d6bdc6f]
%%
%[text] ## Consumption Power Graph
figure; %[output:566f4282]
hold on %[output:566f4282]
plot(powerDates, powerConsumed_kW) %[output:566f4282]
xlabel("date") %[output:566f4282]
ylabel("power consumed (kW)") %[output:566f4282]
title("Instantatenous Power Consumed"); %[output:566f4282]
hold off %[output:566f4282]
%%
%[text] ## Consumption Energy Graph
figure; %[output:656b3e86]
hold on %[output:656b3e86]
plot(powerDates, energyConsumedTotal_kWh) %[output:656b3e86]
xlabel("date") %[output:656b3e86]
ylabel("total energy consumed (kWh)") %[output:656b3e86]
title("Total Energy Consumed During 2025"); %[output:656b3e86]
hold off %[output:656b3e86]
%%
%[text] ## Power Difference

%%
%[text] ## Calculate Required Number of Turbines for each Case
maxPowerConsumed = max(powerConsumed_kW) %[output:7a71062c]
averagePowerProduced = mean(powerProduced_kW) %[output:038d638a]
requiredTurbines = maxPowerConsumed / averagePowerProduced %[output:767c4b88]

